Defendant Duwayne Douglas Rathsack in court with attorney Victoria Mccandless.  Kimberly Dorice Schoepp appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Matter before the Court for Plea hearing.  Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.

COUNT 1:  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights, addendum to plea questionnaire, and jury instructions received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.  The Court advised defendant that as a convicted felon not to possess any firearms.    Court further advised defendant of voting ineligibility.

COUNT 2:  By operation of law and on state's motion, the Court ordered Count 2 DISMISSED.  

Sentencing proceeded.  Statements made by the state, defense and defendant. 

COUNT 1:  The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 4 YEARS. 
The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 2 YEARS.  
The MAXIMUM TERM OF EXTENDED SUPERVISION IS 2 YEARS.
The defendant IS eligible for the Challenge Incarceration Program and the Substance Abuse Program.

The Court orders this sentence STAYED and places the defendant on PROBATION FOR 3 YEARS with the following conditions:


CONDITIONS OF PROBATION/EXTENDED SUPERVISION (if revoked):
*Serve 10 months in House of Correction with release for employment.  NO good time. No objection to time being served in Waukesha.
*Obtain AODA assessment- complete follow-up treatment;
*Absolute sobriety;
*Obtain/maintain employment;
*Provide DNA sample- pay surcharge;  

The Court ordered defendant to pay a fine of $600.00 plus all mandatory costs, penalties, surcharges, including $50.00 ignition interlock surcharge- to be paid by the end of probation period- any remaining balance to convert to civil judgment; BAIL TO APPLY. Court ordered AODA assessment and Driver's Safety Plan; cooperate with any treatment recommended.  Court ordered defendant's driving privileges revoked for a period of 24 months.  Court ordered defendant restricted to operation of vehicles equipped with an ignition interlock device for 24 months.  The Court instructs defense counsel to advise the defendant of appeal rights.

Defense petition for half-priced ignition interlock device heard and granted by the Court.  Defendant taken into custody to start serving condition time.

